function multiplyAll(arr) {
  var product = 1;
  // Only change code below this line
  var solArray = [];
  for(var i = 0; i<arr.length; i++){
    var sol = 1;
    for(var j = 0; j<arr[i].length; j++){
      sol *=arr[i][j];

    }
    solArray.push(sol);
  }

  for(var i = 0; i<solArray.length; i++){
      product *= solArray[i];

  }
  // Only change code above this line
  return product;
}

